import './App.css';
function RecetaComponent(props) {
  const [receta, setReceta] = useState([])
    useEffect(() => {
      fetch('https://www.themealdb.com/api/json/v1/1/random.php')
        .then((response) => {
          return response.json()
        })
        .then((receta) => {
          setReceta(receta)
        })
      }, [])
  return (
    <div>
      {receta.map((item)=>{
        return(
          <h1>item</h1>
        )
      })}
    </div>
  );
}
export default RecetaComponent;
